INSERT INTO gruppetime VALUES ('BJJ', 'På denne timen lærer du deg hva Brasiliansk Jiu Jitsu (BJJ) er, og får en innføring i grunnteknikkene fra idretten. Denne timen passer for deg som vil ha en introduksjon i kampsport. Det er ikke nødvending med Gi (drakt), men det er anbefalt med behagelige klær uten lommer, knapper og glidelåser. Timen passer for nybegynnere.', 55);
INSERT INTO gruppetime VALUES ('Aqua fitnes', 'Aqua Fitness er trening i vann med inspirerende musikk. Ved å bruke vannet som en motstand i bevegelsene vil man på en skånsom, men effektiv måte, trene både utholdenhet og styrke.', 45);
INSERT INTO gruppetime VALUES ('Bootcamp', 'Dette er en leken, intensiv og morsom time. Funksjonell og enkel trening hvor bruker egen kroppsvekt på ulike styrke og kondisjonsøvelser. Timen passer for alle.', 45);
INSERT INTO gruppetime VALUES ('Total core', 'En styrketime med fokus på mage- og ryggtrening. Ved å jobbe med både dynamiske og statiske øvelser vil du kunne få en sterkere kjerne og bedre holdning.', 30);
INSERT INTO gruppetime VALUES ('Upper body', 'er en styrkeøkt for overkropp, med hovedfokus på rygg, bryst og skuldre. Målet er å styrke de største musklene i overkroppen og forbedre kroppsholdning og funksjonsevne. Du tilpasser tyngden på utstyret etter egen teknikk og styrke. De er en fordel å møte ferdig oppvarmet.', 30);
INSERT INTO gruppetime VALUES ('Interval: Bike', 'En hard og effektiv kondisjonstime med intervaller hvor du kan pushe deg enten på sykkel eller på tredemølle. Intervallene ligger mellom 30 sekunder og 4 minutter. Du justerer selv motstandshjulet på sykkelen. Denne timen passer for deg som vil ta formen til neste nivå.', 45);
INSERT INTO gruppetime VALUES ('Watt Cycling 4x4', 'Se hvor hardt du faktisk jobber på sykkelen og ta treningen din til nye høyder. På timer merket med Watt kjører vi med skjermsystem hvor vi styrer intensitet etter watt. Vi anbefaler deg å lage en bruker på stagesflight.com via nettleser før du deltar på timen.', 45);
INSERT INTO gruppetime VALUES ('Ultimate Rythm', 'En morsom dansetime med inspirasjon fra forskjellige dansestiler. Timen er bygd opp med sang for sang- koreografi og har fokus på å trene hele kroppen. Have fun with the rhythm!', 55);
INSERT INTO gruppetime VALUES ('Step Basic', 'Step Basic er en kondisjonstime som bygger en koreografi med enkle grunntrinn på step. Koreografien er enkel og utfordrer deg med elementer som vendinger, rytmeendringer og intensitet. Høyden på steppen kan du justere slik at den passer ditt nivå.', 55);
INSERT INTO gruppetime VALUES ('Yoga Basic', 'Yoga Basic er en yogatime for deg som er nysgjerrig på å teste ut yoga for første gang. Timen kan også passe for deg som allerede har praktisert en stund men ønsker en grundigere forståelse av yoga. Timen vil gå i et rolig tempo og det kreves ingen forkunnskaper eller erfaring med yoga.', 90);
