-- Database for treningssenteret Get pumped

-- Opprett tabeller

CREATE TABLE avdeling (
	avdelingsnummer INT AUTO_INCREMENT PRIMARY KEY,
	postnummer CHAR(4),
	adresse VARCHAR(100),
	telefonnummer CHAR(8),
	epost VARCHAR(100),
	ansattnummer INT, -- Fremmednøkkel: ansatt(ansattnummer), leder for avdelingen
	navn VARCHAR(50)
);

CREATE TABLE ansatt(
	ansattnummer INT AUTO_INCREMENT PRIMARY KEY,
	fornavn VARCHAR(100),
	etternavn VARCHAR(100),
	postnummer CHAR(4),
	adresse VARCHAR(100),
	telefonnummer CHAR(8),
	epost VARCHAR(100)
);

ALTER TABLE avdeling
ADD FOREIGN KEY(ansattnummer)
REFERENCES ansatt(ansattnummer)
ON DELETE SET NULL;

CREATE TABLE kunde (
	kundenummer INT AUTO_INCREMENT PRIMARY KEY,
	fornavn VARCHAR(100),
	etternavn VARCHAR(100),
	postnummer CHAR(4),
	adresse VARCHAR(100),
	telefonnummer CHAR(8),
	epost VARCHAR(100)
);

CREATE TABLE gruppetime (
	navn VARCHAR(50) PRIMARY KEY,
	beskrivelse VARCHAR(500),
	varighet INT
);

CREATE TABLE kontrakt (
	kundenummer INT,
	startdato DATE,
	avdelingsnummer INT,
	bindingstid BOOLEAN,
	PRIMARY KEY(kundenummer, startdato, avdelingsnummer),
	FOREIGN KEY(kundenummer) REFERENCES kunde(kundenummer) ON DELETE CASCADE,
	FOREIGN KEY(avdelingsnummer) REFERENCES avdeling(avdelingsnummer) ON DELETE CASCADE
);

CREATE TABLE personlig_trener (
	kundenummer INT,
	ansattnummer INT,
	startdato DATE,
	PRIMARY KEY(kundenummer, ansattnummer, startdato),
	FOREIGN KEY(kundenummer) REFERENCES kunde(kundenummer) ON DELETE CASCADE,
	FOREIGN KEY(ansattnummer) REFERENCES ansatt(ansattnummer) ON DELETE CASCADE
);

CREATE TABLE ansettelsesforhold(
	ansattnummer INT,
	avdelingsnummer INT,
	startdato DATE,
	PRIMARY KEY(ansattnummer, avdelingsnummer, startdato),
	FOREIGN KEY(ansattnummer) REFERENCES ansatt(ansattnummer) ON DELETE CASCADE,
	FOREIGN KEY(avdelingsnummer) REFERENCES avdeling(avdelingsnummer) ON DELETE CASCADE
);

CREATE TABLE ledelsesForhold(
	ansattnummer INT,
	avdelingsnummer INT,
	startdato DATE,
	PRIMARY KEY(ansattnummer, avdelingsnummer, startdato),
	FOREIGN KEY(ansattnummer) REFERENCES ansatt(ansattnummer) ON DELETE CASCADE,
	FOREIGN KEY(avdelingsnummer) REFERENCES avdeling(avdelingsnummer) ON DELETE CASCADE
);

CREATE TABLE gruppetimeTilbud(
	navn VARCHAR(50),
	avdelingsnummer INT,
	PRIMARY KEY(navn, avdelingsnummer),
	FOREIGN KEY(navn) REFERENCES gruppetime(navn) ON DELETE CASCADE,
	FOREIGN KEY(avdelingsnummer) REFERENCES avdeling(avdelingsnummer) ON DELETE CASCADE
);

CREATE TABLE gruppetimeOversikt(
	navn VARCHAR(50),
	avdelingsnummer INT,
	ansattnummer INT,
	tidspunkt TIMESTAMP,
	antallKunder INT,
	PRIMARY KEY(navn, avdelingsnummer, ansattnummer, tidspunkt),
	FOREIGN KEY(navn) REFERENCES gruppetime(navn) ON DELETE CASCADE,
	FOREIGN KEY(avdelingsnummer) REFERENCES avdeling(avdelingsnummer) ON DELETE CASCADE,
	FOREIGN KEY(ansattnummer) REFERENCES ansatt(ansattnummer) ON DELETE CASCADE
);

